  this.hare.run() /
  this.tortoise.run() /
  do in order / {
    this.hare.say(I'm too fast.) /
    this.hare.say(Too fast for you.) /
  }
}
count 2 / {
  this.hare.jump for joy() /
}
this.hare.say(Looks like I win!) /
this.treasureChest.surprise() /

this.troll.think(These allergies are bad) /
count 3 / {
  do together / {
    this.troll.sneeze() /
    this.boat.move(TypeExpression.BACKWARD, 1.0) /
  }
}
do together / {
  this.phoenix.fly past() /
  do in order / {
    this.phoenix.say(Bless you!) /
    this.troll.look at(this.phoenix) /
  }
}

this.bunny.think(I'm bored..) /
do together / {
  this.bunny.walk(2.0) /
  do in order / {
    this.bunny.say(Let's play leapfrog!) /
    this.bunny.say(I'll go first!) /
  }
}
do together / {
  count 2 / {
    this.bunny.leap over(this.yetiBaby) /
    this.yetiBaby.leap over(this.bunny) /
  }
  this.camera.move(TypeExpression.RIGHT, 3.0) /
}

this.witch.say(It's time to practice my light spell!) /
do together / {
  count 4 / {
    this.witch.cast spell() /
    this.witch.turn(TypeExpression.LEFT, 0.125) /
  }
  do in order / {
    this.cheshireCat.show up() /
    this.alien.show up() /
    this.yeti.show up() /
    this.bright light() /
  }
}

this.witch.turnToFace(this.cauldron) /
do together / {
  count 3 / {
    this.witch.cast spell() /
  }
  do in order / {
    this.cauldron.spin() /
    this.cauldron.glow() /
  }
}
this.bigBadWolf.rise() /

this.Witch.say(I think something went wrong..) /
do together / {
  this.cauldronLid.go crazy() /
  do in order / {
    this.Witch.say(Quick! Stop it!) /
    this.Troll.moveToward(this.Cauldron, 1.0) /
    this.Troll.stop(this.cauldronLid) /
  }
}
this.Witch.say(Well done!) /
count 2 / {
  this.Witch.celebrate() /
}

this.mapinguari.say(What do you call a bear in the rain?) /
this.mapinguari.say(A drizzly bear!) /
do together / {
  this.mapinguari.say(Ha ha ha!) /
  count 2 / {
    this.mapinguari.laugh() /
  }
  do in order / {
    this.mapinguari.rest hands on belly() /
    this.mapinguari.lean back() /
  }
}

this.stuffedTiger.look at fin() /
this.stuffedTiger.think(Uh oh..) /
do together / {
  this.fishingBoat.move(TypeExpression.FORWARD, 80.0) /
  do in order / {
    count 3 / {
      this.dolphin.jump out of water() /
    }
    this.dolphin.swim away() /
  }
}

this.yeti.say(Watch closely) /
do together / {
  count 2 / {
    this.yeti.roar() /
  }
  do in order / {
    this.yetiBaby.watch closely(this.yeti) /
    do together / {
      this.yetiBaby.getLeftShoulder().turn(TypeExpression.BACKWARD, 0.375) /
      this.yetiBaby.getRightShoulder().turn(TypeExpression.BACKWARD, 0.375) /
      this.yetiBaby.say(Rawr!) /
    }
  }
}
